    public void LoadGaugedPoints(string rawData)
    {
        if(rawData.IsNullOrEmpty())
        {
            rawData = testData;
        }

        GaugePointsData_External deserializedData = JsonUtility.FromJson<GaugePointsData_External>(rawData);
        ShowCorrosionData(deserializedData);
        rawData = null;
    }

    private List<Subpart> shownPlates = new List<Subpart>();
    public void ResetCorrosionData()
    {
        foreach (var item in shownPlates)
        {
            item.ResetDimunation();
        }

        shownPlates.Clear();
        corrosionDataCache = null;
        isCorrosionShowing = false;
    }

    public void GenerateSampleData()
    {
        ResetCorrosionData();

        string compartment = ApplicationStateMachine.Instance.GetCurrentState<CompartmentViewState>().GetTargettedCompartemnt();
        var compartmentData = GroupingManager.Instance.vesselObject.GetCompartment(compartment);

        CorrosionData data = new CorrosionData();
        data.compartments = new List<CorrosionDataCompartmentObject>();

        CorrosionDataCompartmentObject corrosionDataCompartmentObject = new CorrosionDataCompartmentObject();
        corrosionDataCompartmentObject.assetName = compartmentData.name;
        corrosionDataCompartmentObject.assetUID = compartmentData.uid;
        corrosionDataCompartmentObject.frames = new List<CorrosionDataFrameObject>();

        foreach (var hullpart in compartmentData.hullpartLookup)
        {
            CorrosionDataFrameObject corrosionDataFrameObject = new CorrosionDataFrameObject();
            corrosionDataFrameObject.frameName = hullpart.Value.name;

            foreach (var subpart in hullpart.Value.data)
            {
                CorrosionDataPlateObject corrosionDataPlateObject = new CorrosionDataPlateObject();
                corrosionDataPlateObject.plateName = subpart.prt_name;
                corrosionDataPlateObject.corrosionValue = Random.Range(0f, 150f);
                corrosionDataFrameObject.plates.Add(corrosionDataPlateObject);
            }

            corrosionDataCompartmentObject.frames.Add(corrosionDataFrameObject);
        }

        data.compartments.Add(corrosionDataCompartmentObject);

        ShowCorrosionData(data);

        string json = JsonUtility.ToJson(data, true);
        JsonFileWriter.WriteJsonToFile(json, "CorrosionData");
    }

    public override void Initialize(CorrosionStatusService_DataClass data)
    {
        base.Initialize(data);

        EventBroadcaster.OnCompartmentLoadingComplete += RefreshCorrosionData;
    }

    private void RefreshCorrosionData(string obj)
    {
        if(isCorrosionShowing && corrosionDataCache != null)
        {
            ShowCorrosionData(corrosionDataCache);
        }
    }

    private bool isCorrosionShowing = false;
    private CorrosionData corrosionDataCache = null;
    private int taskId = 0;

    public void ShowCorrosionData(CorrosionData gaugePointsData)
    {
        taskId++;
        var showTask = ShowCorrosionDataAsync(gaugePointsData, taskId);
    }

    public async Task ShowCorrosionDataAsync(CorrosionData gaugePointsData, int taskId)
    {
        isCorrosionShowing = true;

        var stopwatch = new System.Diagnostics.Stopwatch();
        stopwatch.Start();

        corrosionDataCache = gaugePointsData;

        foreach (var compartment in gaugePointsData.compartments)
        {
            foreach (var hullpart in compartment.frames)
            {
                foreach (var subpart in hullpart.plates)
                {
                    if(taskId != this.taskId || !isCorrosionShowing)
                    {
                        return;
                    }

                    if (GroupingManager.Instance.vesselObject.TryGetSubpart(compartment.assetUID, hullpart.frameName, subpart.plateName, out Subpart plateObject))
                    {
                        shownPlates.Add(plateObject);

                        Color corrosionColor;
                        if (subpart.corrosionValue < 75f)
                        {
                            corrosionColor = Color.green; // Set to GREEN if CalculatedColorValue is less than 75%
                        }
                        else if (subpart.corrosionValue >= 75f && subpart.corrosionValue <= 100f)
                        {
                            corrosionColor = Color.yellow; // Set to YELLOW if CalculatedColorValue is between 75% and 100%
                        }
                        else
                        {
                            corrosionColor = Color.red; // Set to RED if CalculatedColorValue is greater than 100%
                        }

                        plateObject.ShowDimunation(corrosionColor);
                    }

                    if (stopwatch.Elapsed.TotalMilliseconds > 50)
                    {
                        await Task.Yield();
                        stopwatch.Restart();
                    }
                }
            }
        }
    }

    private void ShowCorrosionData(GaugePointsData_External gaugePointsData)
    {
        foreach (var compartmentData in gaugePointsData.compartments)
        {
            if (compartmentData.assetUID.IsNullOrEmpty() || compartmentData.assetUID == "0")
            {
                continue;
            }

            foreach (var frameData in compartmentData.frames)
            {
                foreach (var plateData in frameData.plates)
                {
                    float totalDiminution = -1f;

                    foreach (var pointData in plateData.gaugingPoints)
                    {
                        if (pointData.measuredThickness < 0)
                        {
                            continue;
                        }

                        GaugePointData gaugePointData = new GaugePointData()
                        {
                            id = int.Parse(pointData.point_Id),
                            plate = plateData.plateName,
                            frame = frameData.frameName,
                            comparment = compartmentData.assetName,
                            uId = compartmentData.assetUID,
                            location = pointData.location.GetVector(),
                            normal = pointData.normal.GetVector(),
                            originalThickness = pointData.originalThickness,
                            ruledThickness = pointData.ruledThickness,
                            measuredThickness = pointData.measuredThickness
                        };
                        totalDiminution += GetCorrosionValue(gaugePointData.originalThickness, gaugePointData.measuredThickness);
                    }

                    if (totalDiminution < 0f)
                    {
                        continue;
                    }

                    float averageDiminution = totalDiminution/plateData.gaugingPoints.Count;

                    if (GroupingManager.Instance.vesselObject.TryGetSubpart(compartmentData.assetUID, frameData.frameName, plateData.plateName, out Subpart plateObject))
                    {
                        shownPlates.Add(plateObject);

                        Color corrosionColor;
                        if (averageDiminution < 75f)
                        {
                            corrosionColor = Color.green; // Set to GREEN if CalculatedColorValue is less than 75%
                        }
                        else if (averageDiminution >= 75f && averageDiminution <= 100f)
                        {
                            corrosionColor = Color.yellow; // Set to YELLOW if CalculatedColorValue is between 75% and 100%
                        }
                        else
                        {
                            corrosionColor = Color.red; // Set to RED if CalculatedColorValue is greater than 100%
                        }

                        //corrosionColor = data.corrosionGradiant.Evaluate(averageDiminution / 100f);
                        plateObject.ShowDimunation(corrosionColor);
                    }
                }
            }
        }
    }

    public static float GetCorrosionValue(float originalThickness, float measuredThickness)
    {
        return ((originalThickness - measuredThickness) * 100f) / (originalThickness * (corrosionPercent / 100f));
    }

    public override void Update() { }

    public override void Kill() 
    {
        ResetCorrosionData();
    }
